import React from 'react'
import AllData from './Musicdata.json';

const Music = () => {
  const data=[];
  const getall=()=>{
    data=AllData;
  }
  return (
    <div className='music'>
      <div className="container">
        <div className="btns">
          <button
          onClick={getall}
          >All items</button>
          <button>Music Art</button>
          <button>Digital Art</button>
          <button> Block Art</button>
          <button>Blockchain</button>
          <button>Virtual</button>
        </div>
        <h1>items currently in the market</h1>
        <div className="row">
          {
            data.map((da)=>{
              return <div>
                {da.end}
              </div>
            })
          }
          {
            AllData.map((Data)=>{
              return(<div>{}</div>)
            })
          }
        </div>
      </div>
    </div>
  )
}

export default Music
